description:
Goldie's Private View of Matisse

Arts Documentary hosted by Clifford Joseph Price, published by BBC in 2014 - English narration


Information
------------------------------

Music star, actor and artist Goldie gets a sneak preview and takes us on a personal tour of the new blockbuster exhibition at Tate Modern, which features one of the giants of Modern Art.
Henri Matisse, his health failing, reinvented himself towards the end of his life with a bold and striking new technique, the cut-out. It produced some of his most famous and recognisable works and the Tate's exhibition is a once-in-a-lifetime chance to see Matisse's celebrated cut-outs together in one place.

